Here's my nginx config, fwiw:
```
user www-data;
worker_processes auto;
pid /run/nginx.pid;
include /etc/nginx/modules-enabled/*.conf;
events {
    worker_connections 20000;
}
http {
    ignore_invalid_headers off;
    client_max_body_size 0;
    log_format proxylog '$remote_addr - $remote_user upstream=$upstream_addr [$time_local] ($request_time) '
                '"$request" $status $body_bytes_sent '
                '"$http_referer" "$http_user_agent"';
    upstream wombo {
      least_conn;
      server 10.87.1.40:3050;
      server 10.87.1.67:3050;
      server 10.87.1.194:3050;
      server 10.87.1.185:3050;
      server 10.87.1.233:3050;
      server 10.87.1.163:3050;
      server 10.87.1.40:3051;
      server 10.87.1.67:3051;
      server 10.87.1.194:3051;
      server 10.87.1.185:3051;
      server 10.87.1.233:3051;
      server 10.87.1.163:3051;
      server 10.87.1.40:3052;
      server 10.87.1.67:3052;
      server 10.87.1.194:3052;
      server 10.87.1.185:3052;
      server 10.87.1.233:3052;
      server 10.87.1.163:3052;
      server 10.87.1.40:3053;
      server 10.87.1.67:3053;
      server 10.87.1.194:3053;
      server 10.87.1.185:3053;
      server 10.87.1.233:3053;
      server 10.87.1.163:3053;
      server 10.87.1.40:3054;
      server 10.87.1.67:3054;
      server 10.87.1.194:3054;
      server 10.87.1.185:3054;
      server 10.87.1.233:3054;
      server 10.87.1.163:3054;
      server 10.87.1.40:3055;
      server 10.87.1.67:3055;
      server 10.87.1.194:3055;
      server 10.87.1.185:3055;
      server 10.87.1.233:3055;
      server 10.87.1.163:3055;
      server 10.87.1.40:3056;
      server 10.87.1.67:3056;
      server 10.87.1.194:3056;
      server 10.87.1.185:3056;
      server 10.87.1.233:3056;
      server 10.87.1.163:3056;
      server 10.87.1.40:3057;
      server 10.87.1.67:3057;
      server 10.87.1.194:3057;
      server 10.87.1.185:3057;
      server 10.87.1.233:3057;
      server 10.87.1.163:3057;
    }
    server {
        access_log /var/log/nginx/access.log proxylog;
        listen 127.0.0.1:3048;
        listen 10.87.1.40:3048;
        location / {
            proxy_pass                http://wombo;
            proxy_next_upstream       error timeout invalid_header http_500 http_502;
            proxy_next_upstream_tries 5;
            proxy_connect_timeout     1;
        }
    }
    upstream womborouter {
        server 10.87.1.67:3048;
        server 127.0.0.1:3048 backup;
    }
    server {
        access_log /var/log/nginx/access.log proxylog;
        listen 127.0.0.1:3049;
        location / {
            proxy_pass                http://womborouter;
            proxy_next_upstream       error timeout invalid_header http_500 http_502;
            proxy_next_upstream_tries 5;
            proxy_connect_timeout     1;
        }
    }
}
```

these were what helped me a lot:

```
proxy_next_upstream       error timeout invalid_header http_500 http_502;
proxy_next_upstream_tries 5;
proxy_connect_timeout     1;
```

